import Jumbotron from "react-bootstrap/Jumbotron";

function Header() {
  return (
    <Jumbotron>
      <h1 className="header text-center">
        Press any key to get the JavaScript KeyCode
      </h1>
    </Jumbotron>
  );
}

export default Header;
